// 踏破铁骑，江湖路远，快速刀侠法现江湖，一招之下，天下归正，万物有序。
// 门宗内弟子众多，但若要选出其中最杰出之才，并非易事。
function quickSort(arr) {
  // 江湖中，有无数的门派与独行侠，当弟子单一时，江湖便无风云变幻，一切归于平静。
  if (arr.length <= 1) return arr;

  // 以一派之长为首，设立为擂主，江湖群雄将按其武艺高低，分立左右两堂。
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 江湖中流传着无数挑战，各堂弟子依次挑战，以证武艺。
  for (let i = 1; i < arr.length; i++) {
    // 若有弟子武学修为尚不及擂主者，便纳入左堂以待来日。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 已达擂主水平者或更强者，则纳入右堂，以图后会。
      right.push(arr[i]);
    }
  }
  // 武学之争，永无止境。左右两堂弟子在各自堂中，亦有其挑战和历练，以期成为下一段传奇。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
